import React from 'react'
import { PRODUCTS } from '../../products'
const Shop = () => {
  return (
    <div>
      <div className="shop-title">
          <h1>Mhadhbi Tech Shop </h1>
      </div>        
      <div className="products">
        {PRODUCTS.map(product=><Product/>)}
      </div>
    </div>
  )
}

export default Shop
